export default function getCityWeatherData(e) {
    console.log("hi");
    console.log(e.currentTarget.parentNode.parentNode.children);
    let index;
    for (index = 0; index < 3; index++) {
        if (e.currentTarget.parentNode == e.currentTarget.parentNode.parentNode.children[index]) {
            break;
        }
    }
    console.log(index);
}
